function interpolateThreeColors(percentage) {
    var color1 = '#8FFF53';
    var color2 = '#FFFF00';
    var color3 = '#FF0000';
  color1 = color1.replace(/^#/, '');
  color2 = color2.replace(/^#/, '');
  color3 = color3.replace(/^#/, '');

  var r1 = parseInt(color1.substring(0, 2), 16);
  var g1 = parseInt(color1.substring(2, 4), 16);
  var b1 = parseInt(color1.substring(4, 6), 16);

  var r2 = parseInt(color2.substring(0, 2), 16);
  var g2 = parseInt(color2.substring(2, 4), 16);
  var b2 = parseInt(color2.substring(4, 6), 16);

  var r3 = parseInt(color3.substring(0, 2), 16);
  var g3 = parseInt(color3.substring(2, 4), 16);
  var b3 = parseInt(color3.substring(4, 6), 16);

  if (percentage <= 50) {
    var r = Math.round(r1 + (r2 - r1) * (percentage / 50));
    var g = Math.round(g1 + (g2 - g1) * (percentage / 50));
    var b = Math.round(b1 + (b2 - b1) * (percentage / 50));
  } else {
    var r = Math.round(r2 + (r3 - r2) * ((percentage - 50) / 50));
    var g = Math.round(g2 + (g3 - g2) * ((percentage - 50) / 50));
    var b = Math.round(b2 + (b3 - b2) * ((percentage - 50) / 50));
  }

  return '#' + r.toString(16).padStart(2, '0') +
               g.toString(16).padStart(2, '0') +
               b.toString(16).padStart(2, '0');
}

